 import React  from 'react';
import ReactDOM from 'react-dom';

function Card(){
  return(
    <>
  <div className="card">
  <img src="" className="card-img" alt="myPic"  />
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pexels.com%2Fsearch%2Fbeautiful%2F&psig=AOvVaw2dairgaaXgbusoceI2Ot8l&ust=1671537902330000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCIitx4jShfwCFQAAAAAdAAAAABAR" className="primary">
    <button>Watch Now</button>
    </a>
  </div>
</div>
</>
  );
}

ReactDOM.render(
<>
<Card imgsrc="https://images.pexels.com/photos/268533/pexels-photo-268533.jpeg?cs=srgb&dl=pexels-pixabay-268533.jpg&fm=jpg" name="" />
<Card />
<Card />
</>,
 document.getElementById("root")

);
